CREATE FUNCTION public.bergini_yazyan() RETURNS integer
    LANGUAGE plpgsql
    AS $$
DECLARE
    direc RECORD;
    ex RECORD;
BEGIN
        FOR direc IN 
            ( with
                exe as (
                    select card_dec_id, sum(dol) as d, sum(tmt) as t, sum(tmt/is_zero(kurs)) as dt from exes group by card_dec_id
                ),
                card as (
                    select cd.dec_order_id, sum(exe.d) as d, sum(exe.t) as t, sum(exe.dt) as dt from card_dec cd
                    left join exe on exe.card_dec_id = cd.id group by cd.dec_order_id
                ),
                orders as (
                    select dor.id, c.d as dol, c.t as tmt, c.dt, 'out' as type, (trailer_number || ' ' || 'zakaz ucin tolendi') as why, 'o' as t, created_at
                    from declarant_orders dor
                    inner join card c on c.dec_order_id = dor.id
                    where dor.border_id = 1 and c.t != 0
                ),
                bal_his as (
                    select bh.uuid, bh.dol, bh.tmt, (bh.tmt/is_zero(bh.kurs)) as dt, bh.type, bh.purpose_of_payment as why, 'b' as t, created_at
                    from balance_history bh where bh.border_id = 1
                )
            select * from orders union select * from bal_his where type = 'out' 
                order by created_at
            )
        LOOP
            IF direc.t = 'b' THEN
                VALUES(direc.tmt, direc.id, 1);
            ELSE 
                FOR ex IN (
                    select id, tmt from exes where card_dec_id in (select id from card_dec where dec_order_id = direc.id) and ( dol != 0 or tmt != 0 )
                ) LOOP
                    VALUES(ex.tmt, ex.id, 1);
                END LOOP;
            END IF;
        END LOOP;

        RETURN 1;
END;
$$;


