-- Name: receive_money(integer, integer); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.receive_money(border_id integer, id integer) RETURNS integer
    LANGUAGE plpgsql
    AS $$
DECLARE
    later_money RECORD;
    money RECORD;
BEGIN

        select coalesce(kurs, 0) as kurs, coalesce(dol, 0)::int as dol, coalesce(tmt,0)::int as tmt INTO money 
        from border_send_money bsm where bsm.uuid = receive_money.id ;

        update border_send_money bsm set status = 't' where bsm.uuid = receive_money.id;

        FOR later_money IN SELECT tmt, exes_id FROM get_later_money WHERE get_later_money.border_id = receive_money.border_id LOOP
            IF later_money.tmt <= money.tmt THEN
                money.tmt = money.tmt - later_money.tmt ;

                UPDATE exes SET kurs = money.kurs where exes.id = later_money.exes_id;

                DELETE FROM get_later_money where tmt = later_money.tmt and exes_id = later_money.exes_id ; 
            END IF;
        END LOOP;

        update border_balance bb set dol = coalesce(dol,0) + money.dol, tmt = coalesce(tmt,0) + money.tmt
        where bb.border_id = receive_money.border_id;

        IF money.tmt != 0 THEN
            values( (select bb.id from border_balance bb where bb.border_id = receive_money.border_id), money.tmt, money.kurs );
        END IF;

    
    RETURN money.kurs;
END;
$$;


