CREATE FUNCTION public.updateconsents(worker_id uuid, edit_type character varying, arr_consents integer[]) RETURNS void
    LANGUAGE plpgsql
    AS $$
declare
    a int;
BEGIN

    if edit_type = 'edit' then
        update consents set is_edit = 'f' where consents.worker_id = updateConsents.worker_id;
        foreach a in array arr_consents loop
            update consents set is_edit = 't' where consents.worker_id = updateConsents.worker_id and consents.category_id = a;
        end loop;
    elseif edit_type = 'view' then
        update consents set is_view = 'f' where consents.worker_id = updateConsents.worker_id;

        foreach a in array arr_consents loop
            update consents set is_view = 't' where consents.worker_id = updateConsents.worker_id and consents.category_id = a;
        end loop;
    end if;
END $$;


